List<int> tail(List<int> xs) {
  List<int> res = <int>[];
  int i = 1;
  while (i < xs.length) {
    res = [...res, xs[i]];
    i = i + 1;
  }
  return res;
}

List<int> rotate_left(List<int> xs) {
  if (xs.length == 0) {
    return xs;
  }
